import { Box, Button } from '@material-ui/core';

const Materialroom = () => {
  console.log('myHome');

  return (
    <>
      <Box>
        <Link to="">
          <Button
            sx={{
              cursor: 'pointer',
              width: 150,
              height: 55,
              m: 2,
              mt: 50,
              ml: 30,
              display: 'flex',
              flexDirection: 'column'
            }}
            color="primary"
            component="a"
            // href="https://react-material-kit.devias.io"
            variant="contained"
          >
            회원가입
          </Button>
        </Link>
      </Box>
    </>
  );
};

export default Materialroom;
